import React from 'react'
import { useState,useEffect } from 'react';
import { Link } from 'react-router-dom';
const Register = () => {

  const [formData, setFormData] = useState({
    name:'',
    email: '',
    pass: '',
  });

  // Handle form field changes
  // const handleChange = (e) => {
  //   const { name, value } = e.target;
  //   setFormData({ ...formData, [name]: value });
  // };


  const handleSubmit = async () => {

    fetch('http://localhost/API/register')
    .then((res) => {
      return res.json();
    })
    .then((data) => {
      console.log(data);
      setFormData(data);
    });

    // API endpoint for user registration
    //const registrationEndpoint = 'http://localhost/API/register'; // Replace with your actual API endpoint

    // try {
    //   const response = await fetch(registrationEndpoint, {
    //     method: 'POST',
    //     headers: {
    //       "Content-Type": 'application/json',
    //       "Accept":'application/json'


    //     },
    //     cors:'no-cors',
    //     body: JSON.stringify(formData),
    //   });
        
    //     const responseData = await response.json();
    //     console.log(responseData);
    //     console.log('API Response:', response);
    
    // } catch (error) {
    //   console.log(error);
    //   console.error('An error occurred during registration:');

    // }

  
  };

  useEffect(() => {
    handleSubmit();
  }, []);
  return (
<section className="">
  <div className="px-4 py-5 px-md-5 text-center text-lg-start" style={{backgroundColor: "hsl(0, 0%, 96%)"}}>
    <div className="container">
      <div className="row gx-lg-5 align-items-center">
        <div className="col-lg-6 mb-5 mb-lg-0">
          <h1 className="my-5 display-3 fw-bold ls-tight">
           WebApp <br />
            <span className="text-primary">Registration</span>
          </h1>
          <p style={{color: "hsl(217, 10%, 50.8%)"}}>
           
          </p>
        </div>

        <div className="col-lg-6 mb-5 mb-lg-0">
          <div className="card">
            <div className="card-body py-5 px-md-5">
              <form onSubmit={handleSubmit}>
                <div className="row">
                 
                  <div data-mdb-input-init className="form-outline mb-4">
                    <div data-mdb-input-init className="form-outline">
                      <input type="text" id="form3Example2" value={formData.name} onChange={(e) => setFormData(e.target.value)} className="form-control" />
                      <label className="form-label" for="form3Example2">Name</label>
                    </div>
                  </div>
                </div>

               
                <div data-mdb-input-init className="form-outline mb-4">
                  <input type="email" id="form3Example3" value={formData.email} onChange={(e) => setFormData(e.target.value)} className="form-control" />
                  <label className="form-label" for="form3Example3">Email address</label>
                </div>

             
                <div data-mdb-input-init className="form-outline mb-4">
                  <input type="password" id="form3Example4" value={formData.pass} onChange={(e) => setFormData(e.target.value)} className="form-control" />
                  <label className="form-label" for="form3Example4">Password</label>
                </div>

              
                {/* <div className="form-check d-flex justify-content-center mb-4">
                  <input className="form-check-input me-2" type="checkbox" value="" id="form2Example33" checked />
                  <label className="form-check-label" for="form2Example33">
                    Subscribe to our newsletter
                  </label>
                </div> */}

               
                <button type="submit" data-mdb-button-init data-mdb-ripple-init className="btn btn-primary btn-block mb-4">
                  Sign up
                </button>
                <div class="text-center">
                  <span>Sign In : <Link to="/"> Login </Link></span>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  </div>
  
</section>

  )
}
export default Register;
